window.bookSummaryJSON = "An ancient wonder. A bitter rival. Will securing his family's legacy get him killed?<br>Darwin Lacroix has made an incredible discovery, but his lack of proof gnaws at him daily. After putting his wedding to the captivating Eyrun on hold, the archaeologist receives a tip that could finally prove his grandfather's research. There's just one catch: To make the find, he'll have to forge an uneasy alliance with a cunning Italian archrival.<p>When the partnership gets him closer than ever to the Library of Alexandria, Darwin fears that his hope may blind him to the truth. But the explorer's attempt to keep his own secrets could risk his life. It could put the ones he loves right into the scorching line of fire.</p><p>Will Darwin have to pay for the discovery of a lifetime with his final dying breath?</p><p>Hypatia’s Diary is the second book in the gripping Darwin Lacroix Adventure archaeological thriller series. If you like treacherous exploits, high-tech explorations, and ancient enigmas, then you’ll love Dave Bartell’s curation campaign.</p><p>Buy or download Hypatia’s Diary to unearth a storied mystery today!</p><p></p>"; 
